import React from "react";
import './styles/App.css';
import {BrowserRouter, Route, Router} from "react-router-dom";
import About from "./pages/About";
import Posts from "./pages/Posts";

function App() {
    return (
        <BrowserRouter>
            <Router>
                <Route path="/about" element={<h1>askmalskn</h1>}/>
            </Router>
        </BrowserRouter>
    );
};

export default App;
